class Data {
  Data({
    List<MyFund>? myFund,
    List<MyFund>? joinedFund,
  }) {
    _myFund = myFund;
    _joinedFund = joinedFund;
  }

  Data.fromJson(dynamic json) {
    if (json['my_fund'] != null) {
      _myFund = [];
      json['my_fund'].forEach((v) {
        _myFund?.add(MyFund.fromJson(v));
      });
    }
    if (json['joined_fund'] != null) {
      _joinedFund = [];
      json['joined_fund'].forEach((v) {
        _joinedFund?.add(MyFund.fromJson(v));
      });
    }
  }

  List<MyFund>? _myFund;
  List<MyFund>? _joinedFund;

  Data copyWith({
    List<MyFund>? myFund,
    List<MyFund>? joinedFund,
  }) =>
      Data(
        myFund: myFund ?? _myFund,
        joinedFund: joinedFund ?? _joinedFund,
      );

  List<MyFund>? get myFund => _myFund;

  List<MyFund>? get joinedFund => _joinedFund;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_myFund != null) {
      map['my_fund'] = _myFund?.map((v) => v.toJson()).toList();
    }
    if (_joinedFund != null) {
      map['joined_fund'] = _joinedFund?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

